import React from "react";
import { View, Image, StyleSheet, ImageBackground, TouchableOpacity, ActivityIndicator, Thumbnail } from "react-native";
import { API_URL } from "./../Utility/AppConst";
import Collapsible from 'react-native-collapsible';
import DatePicker from 'react-native-datepicker';
import RNPickerSelect, { defaultStyles } from 'react-native-picker-select';
import AsyncStorage from '@react-native-async-storage/async-storage';
import {
  Container,
  Content,
  Form,
  Item,
  Input,
  Label,
  Button,
  Text,
  Body,
  H2,
  Icon,
} from "native-base";
import loginStyle from "../../style/login/loginStyle";
import globalStyle from "../../style/globalStyle";
import profilestyle from "../../style/profile/profileStyle";
import { useSelector } from 'react-redux'
import { SideBarMenu } from "../sidebar";
import { set } from "react-native-reanimated";
import moment from 'moment';
const UserProfile = (props) => {
  const [adult, setAdult] = React.useState("");
  const [open, setOpen] = React.useState(false);
  const [value, setValue] = React.useState(null);
  const [items, setItems] = React.useState([]);
  const [loader, setloader] = React.useState(true);
  const [studentIds, setStudentIds] = React.useState([]);
  const [firstName, setFirstName] = React.useState("");
  const [lastName, setLastName] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [SchoolName, setSchoolName] = React.useState("");
  const [StudentNumber, setStudentNumber] = React.useState("");
  const [Rank, setRank] = React.useState("");
  const [AcademicSchool, setAcademicSchool] = React.useState("");
  const [MedicalInfo, setMedicalInfo] = React.useState("");
  const [Employer, setEmployer] = React.useState("");
  const [Occupation, setOccupation] = React.useState("");
  const [DOB, setDOB] = React.useState("");

  const [checkFirstname, setCheckFirstname] = React.useState(false);
  const [checklastName, setChecklastName] = React.useState(false);
  const [checkEmail, setCheckEmail] = React.useState(false);
  const [errorMessage, setErrorMessage] = React.useState('');
  const [collapsed, setCollapsed] = React.useState(true);
  const [collapsed2, setCollapsed2] = React.useState(true);
  const [address1, setAddress1] = React.useState("");
  const [address2, setAddress2] = React.useState("");
  const [UniformSizeList, setUniformSizeList] = React.useState([]);
  const [UniformSize, setUniformSize] = React.useState("");
  const [city, setCity] = React.useState("");
  const [state, setState] = React.useState(" ");
  const [zipCode, setZipCode] = React.useState("");
  const [phone1, setPhone1] = React.useState("");
  const [phone2, setPhone2] = React.useState("");
  const [EmergencyContact, setEmergencyContact] = React.useState("");
  const [checkCity, setCheckCity] = React.useState(false);
  const [checkState, setCheckState] = React.useState(false);
  const [checkZipCode, setCheckZipCode] = React.useState(false);

  const [checkSchoolName, setCheckSchoolName] = React.useState(false);
  const [checkAddress1, setCheckAddress1] = React.useState(false);
  const [checkPhone1, setCheckPhone1] = React.useState(false);
  const [checkEmployer, setCheckEmployer] = React.useState(false);
  const [checkOccupation, setCheckOccupation] = React.useState(false);

  const [BeltSizeList, setBeltSizeList] = React.useState([]);
  const [BeltSize, setBeltSize] = React.useState("");
  const [data, setData] = React.useState('');
  const userId = useSelector(state => state);
  const [SuccessMessage, setSuccessMessage] = React.useState('');


  const clearData = () => {
    setFirstName('');
    setCheckFirstname(false)
    setLastName('');
    setEmail('');
    setErrorMessage('');
    setSchoolName();
    setStudentNumber('');
    setRank();
    setAcademicSchool('')
    setState('');
    setCity('');
    setEmployer('');
    setZipCode('')
    setAddress1('');
    setAddress2('');
    setPhone1('');
    setPhone2('')
    //getdata()
    setSuccessMessage('')
  }
  const setschoolName = (event) => {
    setSchoolName(event);
  };
  const setaddress1 = (event) => {
    setAddress1(event);
    if (event == "") {
      setCheckAddress1(true);
    } else {
      setCheckAddress1(false);
    }
  };
  const setaddress2 = (event) => {
    setAddress2(event);
  };
  const setphone1 = (event) => {
    setPhone1(event);
    if (event == "") {
      setCheckPhone1(true);
    } else {
      setCheckPhone1(false);
    }
  };
  const setphone2 = (event) => {
    setPhone2(event);
  };
  const setcity = (event) => {
    setCity(event);
    if (event == "") {
      setCheckCity(true);
    } else {
      setCheckCity(false);
    }
  };
  const setstate = (event) => {
    setState(event.itemValue);
    if (event == "") {
      setCheckState(true);
    } else {
      setCheckState(false);
    }
  };
  const setzipCode = (event) => {
    setZipCode(event);
    if (event == "") {
      setCheckZipCode(true);
    } else {
      setCheckZipCode(false);
    }
  };
  const toggleExpanded = () => {
    setCollapsed(!collapsed);
    setCollapsed2(true);
  };
  const toggleExpanded2 = () => {
    setCollapsed2(!collapsed2);
    setCollapsed(true);
  };
  const stateList = [
    { label: 'Arizona', value: 'AZ' },
    { label: 'Alabama', value: 'AL' },
    { label: 'Alaska', value: 'AK' },
    { label: 'Arkansas', value: 'AR' },
    { label: 'California', value: 'CA' },
    { label: 'Colorado', value: 'CO' },
    { label: 'Connecticut', value: 'CT' },
    { label: 'Delaware', value: 'DE' },
    { label: 'Florida', value: 'FL' },
    { label: 'Georgia', value: 'GA' },
    { label: 'Hawaii', value: 'HI' },
    { label: 'Idaho', value: 'ID' },
    { label: 'Illinois', value: 'IL' },
    { label: 'Indiana', value: 'IN' },
    { label: 'Iowa', value: 'IA' },
    { label: 'Kansas', value: 'KS' },
    { label: 'Kentucky', value: 'KY' },
    { label: 'Louisiana', value: 'LA' },
    { label: 'Maine', value: 'ME' },
    { label: 'Maryland', value: 'MD' },
    { label: 'Massachusetts', value: 'MA' },
    { label: 'Michigan', value: 'MI' },
    { label: 'Minnesota', value: 'MN' },
    { label: 'Mississippi', value: 'MS' },
    { label: 'Missouri', value: 'MO' },
    { label: 'Montana', value: 'MT' },
    { label: 'Nebraska', value: 'NE' },
    { label: 'Nevada', value: 'NV' },
    { label: 'New Hampshire', value: 'NH' },
    { label: 'New Jersey', value: 'NJ' },
    { label: 'New Mexico', value: 'NM' },
    { label: 'New York', value: 'NY' },
    { label: 'North Carolina', value: 'NC' },
    { label: 'North Dakota', value: 'ND' },
    { label: 'Ohio', value: 'OH' },
    { label: 'Oklahoma', value: 'OK' },
    { label: 'Oregon', value: 'OR' },
    { label: 'Pennsylvania', value: 'PA' },
    { label: 'Rhode Island', value: 'RI' },
    { label: 'South Carolina', value: 'SC' },
    { label: 'South Dakota', value: 'SD' },
    { label: 'Tennessee', value: 'TN' },
    { label: 'Texas', value: 'TX' },
    { label: 'Utah', value: 'UT' },
    { label: 'Vermont', value: 'VT' },
    { label: 'Virginia', value: 'VA' },
    { label: 'Washington', value: 'WA' },
    { label: 'West Virginia', value: 'WV' },
    { label: 'Wisconsin', value: 'WI' },
    { label: 'Wyoming', value: 'WY' },
  ]
  const ValidateEmail = (mail) => {
    return /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(mail);
  };
  // Setting data to variables and validations
  const setfirstName = (event) => {
    setFirstName(event);
    if (event == "") {
      setCheckFirstname(true);
    } else {
      setCheckFirstname(false);
    }
  };

  const setlasttName = (event) => {
    setLastName(event);
    if (event == "") {
      setChecklastName(true);
    } else {
      setChecklastName(false);
    }
  };
  const setemail = (event) => {
    setEmail(event);
    if (event == "") {
      setCheckEmail(true);
    } else {
      setCheckEmail(false);
    }
  };
  //Form Submission
  const submitForm = () => {
    setSuccessMessage("");
    if (firstName == "") {
      setCheckFirstname(true);
      return false;
    }
    if (lastName == "") {
      setChecklastName(true)
      return false;
    }
    if (email == "") {
      setCheckEmail(true);
      return false;
    }

    const apiUrl = API_URL.trim();
    // console.log(state)
    fetch(`${apiUrl}/odata/StudentData(${studentIds[0]})`, {
      method: "patch",
      headers: {
        Accept: "*/*",
        "Content-Type": "application/json",
        'Authorization': 'Bearer ' + userId[0].access_Token
      },
      body: JSON.stringify({
        "FirstName": firstName,
        "LastName": lastName,
        "Email": email,
        "Address1": address1,
        "Address2": address2,
        "DOB": DOB,
        "Phone1": phone1,
        "Phone2": phone2,
        "Phone1IsCell": false,
        "Phone2IsCell": false,
        "Employer": Employer,
        "EmergencyContact": EmergencyContact,
        "Occupation": Occupation,
        "MedicalInfo": MedicalInfo,
        "BeltSizeId": BeltSize,
        "UniformSizeId": UniformSize,
        "AcademicSchool": AcademicSchool,
        "City": city,
        "State": state,
        "PostalCode": zipCode,

      }),
    })
      .then((response) => {
        let jsonData = JSON.stringify(response);
        //console.log(jsonData)
        let jsonDataPrase = JSON.parse(jsonData);
        // console.log(jsonDataPrase.status)
        if (jsonDataPrase.status >= 200 && jsonDataPrase.status < 300) {
          setSuccessMessage("Update Successfully");
        } else {
          setErrorMessage("An error has occurred.");
        }
      })
      .catch((response) => {
        setErrorMessage("An error has occurred.");
      });
  };
  React.useEffect(() => {
    navigation.addListener('focus', () => {
      setloader(true)
      clearData()
      setStudentIds([])
      const apiUrl = API_URL.trim();
      if (studentIds.length <= 0) {
        fetch(`${apiUrl}/odata/StudentAccount`, {
          method: "get",
          headers: {
            Accept: "*/*",
            "Content-Type": "application/json",
            'Authorization': 'Bearer ' + userId[0].access_Token
          },
        })
          .then(response => response.json())
          .then(data => {
            //console.log(data) 
            if (data.StudentIds.length > 0) {

              var students = data.StudentIds.length;
              setStudentIds([])
              data.StudentIds.map((id, index) => {
                fetch(`${apiUrl}/odata/StudentData(${id})`, {
                  method: "get",
                  headers: {
                    Accept: "*/*",
                    "Content-Type": "application/json",
                    'Authorization': 'Bearer ' + userId[0].access_Token
                  },
                })
                  .then(response => response.json())
                  .then(data => {
                    if (studentIds.length <= students) {


                      setStudentIds(prevState => [...prevState, data]);
                      //console.log(studentIds)
                    }
                    //setStudentIds(data.StudentIds)
                  })
              })
              getdata(data.StudentIds[0])
            }
            else {
              //  console.log("hhere")
              setloader(false)
            }

          });
        function getdata(id) {
          fetch(`${apiUrl}/odata/StudentData(${id})`, {
            method: "get",
            headers: {
              Accept: "*/*",
              "Content-Type": "application/json",
              'Authorization': 'Bearer ' + userId[0].access_Token
            },
          })
